// components/UserManagementPage.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import ProductService from '../service/ProductService';

function AllProducts() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Fetch users data when the component mounts
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await ProductService.getAllProducts();
      setProducts(response.products); // Assuming the list of products is under the key 'products'
    } catch (error) {
      console.error('Error fetching products:', error);
    }
  };

  const deleteProduct = async (productId) => {
    try {
      const confirmDelete = window.confirm('Are you sure you want to delete this product?');

      if (confirmDelete) {
        await ProductService.deleteProductById(productId);
        fetchProducts();
      }
    } catch (error) {
      console.error('Error deleting product:', error);
    }
  };

  return (
    <div className="product-management-container">
      <h2>Product Management Page</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Product Name</th>
            <th>Product Price</th>
            <th>Product Description</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {products.map(item => (
            <tr key={item.product_id}>
              <td>{item.product_id}</td>
              <td>{item.product_name}</td>
              <td>{item.product_price}</td>
              <td>{item.product_description}</td>
              <td>
                <button className="delete-button" onClick={() => deleteProduct(item.product_id)}>Delete</button>
                <button>
                  <Link to={`/auth/update-product/${item.product_id}`}>Update</Link>
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Internal CSS */}
      <style jsx>{`
        .product-management-container {
          width: 80%;
          margin: 20px auto;
          font-family: Arial, sans-serif;
        }

        h2 {
          text-align: center;
          color: #333;
          margin-bottom: 20px;
        }

        table {
          width: 100%;
          border-collapse: collapse;
          margin-top: 20px;
        }

        table th,
        table td {
          padding: 12px;
          text-align: left;
          border: 1px solid #ddd;
        }

        table th {
          background-color: #f4f4f4;
          font-weight: bold;
        }

        table td {
          background-color: #fff;
        }

        table tr:nth-child(even) td {
          background-color: #f9f9f9;
        }

        table tr:hover td {
          background-color: #f1f1f1;
        }

        .delete-button,
        button {
          padding: 8px 12px;
          border: none;
          background-color: #ff4d4d;
          color: #fff;
          cursor: pointer;
          margin-right: 10px;
          border-radius: 4px;
          font-size: 14px;
        }

        .delete-button:hover,
        button:hover {
          background-color: #e60000;
        }

        button a {
          text-decoration: none;
          color: white;
        }

        button a:hover {
          color: #ccc;
        }

        .reg-button {
          margin-bottom: 20px;
          padding: 10px 15px;
          background-color: #4CAF50;
          color: white;
          border: none;
          border-radius: 4px;
          cursor: pointer;
          font-size: 14px;
          text-align: center;
        }

        .reg-button:hover {
          background-color: #45a049;
        }
      `}</style>
    </div>
  );
}

export default AllProducts;
